import React from 'react';

function Item ({ todo, setTodo }) {
    todo.forEach(element => {
        // console.log(element.title);
        return (
            <div>
                <ul className='Item-ul'>
                    <li className='Item-li'>
        <span className='Item-span'>{element.title}</span>
                    </li>
                    <li className='Item-li'>
                        <button className='Item-btn'>Del</button>
                    </li>
                    <li className='Item-li'>
                        <button className='Item-btn'>Ok</button>
                    </li>
                    <li className='Item-li'>
                        <button className='Item-btn'>Chan</button>
                    </li>
                </ul>
            </div>
        )
    });

};

export default Item;
